import './App.css';
import NavBar from './components/NavBar';


function App() {
  return (
      <div className="App">
        <NavBar/> 
        <h1 className="text-3xl font-bold underline"> HOLA MUNDO!</h1>
        <h2> Vamos con el primer desafio, dejo lo de abajo porque esta muy bueno</h2>
      </div>
  );
}

export default App;
